[P]Коллеги будут Будут работать после 9 числа.

Для того чтобы успешно завершить её и начать процесс выгрузки Вашего объекта на сайт, просим Вас пройти видео-подтверждение.[/P]
[P]Это можно сделать отправив нам записанное видео Вашего объекта в ответном письме или ссылку на видео, предварительно загрузив его в облачное хранилище, такие как Yandex Disk/ Mail Cloud/ Google Drive.[/P]
[P]На видео должны быть четко зафиксированы следующие параметры:[/P]
[*]Ваше лицо, чтобы мы были уверены что на видео тот же человек, который проходил верификацию в Sumsub;
[*]ID Вашего объекта размещения, согласно Экстранет (необходимо произнести вслух в начале видео);
[*]Указатель с названием улицы и номером дома;
[*]Фасад здания;
[*]Объект внутри, в том числе номера, кухня и ванные комнаты;
[*]Вид из окна на соседние здания.[P][/P]
[P]Для видео недопустимы:[/P]
[*]Подборки фотографий или слайд-шоу;
[*]Изменения скорости (перемотка, замедленная или ускоренная съемка);
[*]Прочие эффекты, такие как переходы и фильтры (в том числе черно-белый фильтр), и иные искажения.
[*]Паузы или остановка съемки. Видео обязательно должно быть непрерывным.
